INSERT INTO `reviews` VALUES (1,1,'На экран Retina можно смотреть бесконечно.','2016-09-08 13:18:10'),(2,2,'Это мой первый айфон. Все равно больше нравятся на андроиде. Но в них нету такой идеальной формы для женской руки. А этот красив, и плюс с гранями! Люблю его! В любом чехле он выглядит превосходно.','2016-10-08 16:15:10'),(3,2,'Very Good','2016-10-06 18:42:12'),(5,1,'Very fine','2016-06-02 15:15:15'),(6,1,'Very fine','2016-06-02 15:15:15');
